query = '''WITH SessionData AS (
    SELECT
        anonymousId,
        hitTime,
        LEAD(hitTime) OVER(PARTITION BY anonymousId ORDER BY hitTime) as next_hitTime,
        TIMESTAMP_DIFF(LEAD(hitTime) OVER(PARTITION BY anonymousId ORDER BY hitTime), hitTime, SECOND) as diff_seconds
    FROM `august-monument-187809.Assignments.view_hits_for_sessions`
),

RankedHits AS (
    SELECT
        anonymousId,
        hitTime,
        LAG(hitTime) OVER(PARTITION BY anonymousId ORDER BY hitTime) as prev_hit_time
    FROM
        `august-monument-187809.Assignments.view_hits_for_sessions`
),

SessionFlags AS (
    SELECT
        anonymousId,
        hitTime,
        CASE WHEN TIMESTAMP_DIFF(hitTime, prev_hit_time, MINUTE) >= 30 OR prev_hit_time IS NULL THEN 1 ELSE 0 END AS is_new_session
    FROM
        RankedHits
),

AggregatedSessions AS (
    SELECT
        anonymousId,
        hitTime,
        SUM(is_new_session) OVER(PARTITION BY anonymousId ORDER BY hitTime ROWS BETWEEN UNBOUNDED PRECEDING AND CURRENT ROW) AS session_id
    FROM
        SessionFlags
)

SELECT
    COUNT(DISTINCT(CONCAT(anonymousId, CAST(session_id AS STRING)))) as total_sessions
FROM
    AggregatedSessions
      '''
