import pandasql as ps
import pandas as pd
# Запрос для расчета SLA:
sla_query = """
WITH FilteredCalls AS (
    SELECT
        l.APPID,
        l.START_TIME,
        l.RECIVED,
        a."Город",
        DATE(l.START_TIME) AS call_date,
        CASE WHEN strftime('%H', l.START_TIME) BETWEEN '09' AND '20' AND
                  (strftime('%H', l.START_TIME) != '20' OR strftime('%M', l.START_TIME) <= '30') THEN 1 ELSE 0 END AS is_valid_time,
        CASE WHEN (julianday(l.START_TIME) - julianday(l.RECIVED)) * 24 <= 1 THEN 1 ELSE 0 END AS within_sla
    FROM
        log_df l
    JOIN
        applications_df a ON l.APPID = a."Id заявка"
    WHERE
        l.PRD = 'CCBI'
)

SELECT
    "Город",
    call_date,
    SUM(CASE WHEN is_valid_time = 1 THEN within_sla ELSE 0 END) / COUNT(*) AS SLA
FROM
    FilteredCalls
GROUP BY
    "Город", call_date
ORDER BY
    "Город", call_date;
"""


sla_result = ps.sqldf(sla_query, locals())
print(sla_result.head())

