"""***Задача:*** маркетолог просит вас сделать выгрузку номеров клиентов в хешированном виде (MD5) для смс-рассылки. Выгрузки должны быть в csv-файлах размером 1 млн строк.

Напишите функцию, которая принимает на вход датафрейм из базы данных и на выходе создает csv-файлы с хешированными телефонами.
"""

import hashlib
import pandas as pd
import re
import logging
from google.colab import files

def setup_logger():
    class PrintHandler(logging.Handler):
        def emit(self, record):
            print(self.format(record))

    logger = logging.getLogger()
    for handler in logger.handlers[:]:
        logger.removeHandler(handler)
    logger.setLevel(logging.INFO)

    handler = PrintHandler()
    formatter = logging.Formatter('%(asctime)s - %(levelname)s - %(message)s')
    handler.setFormatter(formatter)
    logger.addHandler(handler)
    return logger

def clean_phone_number(phone):
    return re.sub(r'\D', '', phone)

def is_valid_phone(phone):
    cleaned_phone = clean_phone_number(phone)
    return len(cleaned_phone) >= 10

def hash_phone(phone):
    if not is_valid_phone(phone):
        logger.warning(f"Invalid phone number: {phone}")
        return None
    cleaned_phone = clean_phone_number(phone)
    return hashlib.md5(cleaned_phone.encode('utf-8')).hexdigest()

def create_hashed_csv(df, chunk_size=1000000, log_interval=100000, output_prefix="hashed_phones", columns_to_save=['hashed_phone']):
    if 'phone' not in df.columns:
        logger.error("Dataframe does not contain 'phone' column.")
        return

    logger.info("Starting phone number hashing process.")
    df['hashed_phone'] = df['phone'].apply(hash_phone)

    num_files = len(df) // chunk_size + (1 if len(df) % chunk_size else 0)
    logger.info(f"{num_files} files will be created.")

    for i in range(num_files):
        if i % log_interval == 0:
            logger.info(f"Processing chunk {i + 1} out of {num_files}.")

        start_idx = i * chunk_size
        end_idx = (i + 1) * chunk_size
        filename = f'{output_prefix}_{i+1}.csv'
        df.iloc[start_idx:end_idx].to_csv(filename, index=False, columns=columns_to_save)
        logger.info(f"{filename} created.")

        files.download(filename)

logger = setup_logger()


df = pd.DataFrame()
df['FIO'] = ['Иванов В.В', 'Петров А.В.', 'Смирнов А.А']
df['phone'] = ['79143345656', '89567889050', '+79142334455']

create_hashed_csv(df)

